import React, { Component, Fragment } from 'react';
import { Input, Select, Radio } from 'antd';
//引入css文件
import './style.css';

const { Option } = Select;

class DataUplode extends Component {
    constructor (props) {
        super(props);
        this.state = {
            guiyin:[
                {value:'首次触点归因',id:0},
                {value:'末次触点归因',id:1},
                {value:'线性归因',id:2},
                {value:'基于位置归因',id:3},
                {value:'时间衰减归因',id:4}
            ]
        }
    }

    mapRenderEventOption = () => {
        return this.state.guiyin.map(item => {
            return (
                <Option key={item.id}>{item.value}</Option>
            )
        })
    }

    render() {
        return (
            <Fragment>
                <div className='secondarytitle' style={{ display: 'inline-block' }}>时间选择：</div>
                <Input placeholder='请输入开始时间' className='data_input' />
                <Input placeholder='请输入结束时间' className='data_input' />
                <div className='secondarytitle' style={{ display: 'inline-block' }}>归因模型：</div>
                <Select
                    className='data_select'
                    placeholder='归因模型'
                >
                    {this.mapRenderEventOption()};
                </Select>
                <div className='secondarytitle' style={{ display: 'inline-block' }}>归因窗口期（单位：秒）：</div>
                <Input placeholder='归因窗口期' className='data_input' />
                <div className='secondarytitle' style={{ display: 'inline-block' }}>是否归于其他转换：</div>

            </Fragment>

        )
    }
}

export default DataUplode;
